import axios from 'axios';
import {Solution} from "../../../lib/types/solution";
import {HOSTNAME} from "../../../lib/hostname.config";


export default function getSolutionsByTaskId(taskId: string): Promise<Solution[]> {
	return axios.get(`${HOSTNAME}/api/solutions?taskId=${taskId}`)
}
